import React from "react";
import getImg from "../../Utils/getImg";
import "./Header.scss";

const Header = (props) => {
  return (
    <>
      <div className="sa-header-w">
        <div className="sa-header-tabs-w">
          <img
            src={getImg("MENU.svg")}
            onClick={() => {
              console.log("yup");
              props.toggleOpenMenu();
            }}
            style={
              window["detectMob"]()
                ? { visibility: "visible" }
                : { visibility: "invisible" }
            }
          />
        </div>
      </div>
    </>
  );
};

export default Header;
